(1, 'В спорткомитете заявили о соблюдении ПДД на тренировке велогонщиц', 'В спорткомитете Петербурга считают, что группа велосипедисток перед ДТП с грузовиком на трассе «Скандинавия» передвигалась с соблюдением правил безопасности\r\n\r\nЗампредседателя комитета по физической культуре и спорту Санкт-Петербурга Елена Павлова заявила, что тренировка попавших в ДТП в Ленинградской области велосипедисток проходила с соблюдением правил дорожного движения. Слова Павловой приводит «РИА Новости».\r\n\r\n7 сентября на трассе «Скандинавия» в Выборгском районе группа несовершеннолетних велогонщиц из школы олимпийского резерва Сестрорецка попала в ДТП. По данным полиции, грузовик въехал в сопровождавший колонну спортсменок Ford, а тот налетел на спортсменок. Двое детей погибли, еще семь девочек и тренер были госпитализированы.\r\n\r\n«Был тренировочный процесс. Сейчас рано давать какие-то комментарии, будет проведено расследование всему произошедшему. На первый взгляд, тренировочный процесс осуществлялся с соблюдением правил безопасности дорожного движения. Дальнейшие комментарии будут после расследования», — заявила Павлова.\r\n', , '20th, Sep');

